import React, { Component } from 'react';
import EmployeeService from '../service/EmployeeService';

class EmployeeComponent extends Component {

    constructor(props) {
        super(props);
        this.state = {
            employee: {},
            department: {},
            organization: {}
        }
    }


    componentDidMount(){
        EmployeeService.getEmployee().then((response)=>{
            console.log("Employee---"+response.data.employee)
            this.setState({employee: response.data.employee})
            this.setState({department: response.data.department})
            this.setState({organization: response.data.organization})

            console.log("Employee---"+this.state.employee)
            console.log("Department--"+this.state.department)
            console.log("Organization---"+this.state.organization)
            return response

        })
    }

    render() {
        return (
            <div className='container card offset-md-3'>
                <h3 className='text-center card-header'>View Employee Detailes</h3>
                <div className='card-body'>
                    <div className='row'>
                        <p><strong>Employee FirstName</strong></p>
                    </div>
                    <div className='row'>
                        <p><strong>Employee LastName</strong></p>
                    </div>
                    <div className='row'>
                        <p><strong>Employee Email</strong></p>
                    </div>
                </div>
            </div>
        );
    }
}

export default EmployeeComponent;
